import React from "react";
import styled from "styled-components";
import Neo4j from './Neo4j';

const Button = styled.button`
  background-color: black;
  color: white;
  font-size: calc(10px + 2vmin);
  padding: 10px 60px;
  border-radius: 5px;
  margin: 10px 0px;
  cursor: pointer;
  margin: 20px;
`;


var Neo4jInstance = new Neo4j();

export default class Queries extends React.Component {

    constructor(props){
        super(props);
        this.state = {loading:false};
    }

    async getInfluenceurProducts(idInfluenceur){

        this.setState({...this.state,loading:true})
        await Neo4jInstance.getInfluenceurProducts(idInfluenceur);
        this.setState({...this.state,loading:false})
    }

    render() {
      return (
      <div>
        <p> SQL<br></br>
        
        
        <a>{this.state.loading && "Chargement"}</a>
        <Button>Requête 2</Button>
        <Button >Requête 3</Button>
        
        </p>
        <br></br>
        <br></br>
        <p> NoSQL<br></br> 
            <Button>Requête 1</Button>
            <Button >Requête 2</Button>
            <Button>Requête 3</Button>
        </p>
      </div>
    

    );
  }

}
